import React, { useState } from 'react';
import {
  // Button,
  Card,
  TextField
} from '@material-ui/core';

function AddItemForm() {
  const [item, setItem] = useState({
    barcode: '',
    name: '',
    amount: 0,
    price: 0
  });

  function handleChange(event) {
    const { name, value } = event.target;
    setItem({ [name]: value });
  }

  return (
    <Card>
      <h3>Add new Item</h3>
      <p>{item.barcode + ' ' + item.name}</p>
      <TextField
        label="Barcode"
        variant="outlined"
        name="barcode"
        value={item.barcode}
        onChange={handleChange}
      />
      <TextField
        label="name"
        variant="outlined"
        name="name"
        value={item.name}
        onChange={handleChange}
      />
    </Card>
  );
}

export default AddItemForm;
